// src/components/Navbar.js
import React from "react";
import { Link } from "react-router-dom";

const Navbar = ({ isAuthenticated }) => {
  return (
    <nav className="bg-[#222831] text-white p-4 fixed w-full top-0 left-0 z-10">
      <div className="container mx-auto flex items-center justify-between">
        <div className="text-lg font-bold">Job Portal</div>
        <div className="flex space-x-6">
          <Link to="/" className="hover:text-blue-400">Home</Link>
          <Link to="/jobs" className="hover:text-blue-400">Jobs</Link>
          {!isAuthenticated ? (
            <>
              <Link to="/signup" className="hover:text-blue-400">Sign Up</Link>
              <Link to="/login" className="hover:text-blue-400">Login</Link>
            </>
          ) : (
            <Link to="/profile" className="hover:text-blue-400">Profile</Link>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
